const objectCard = {
    template:
    /*html*/
    `
    <div class="objectCard">
        <img class="objectCard-image" :src="objectimage">
        <h5> {{ objectname }} </h5>
        <h6> {{ objectcreator[0] }} </h6>
    </div>
    `,

    
    props: {
        objectname: {
            type: String,
            required: true
        },
        objectimage: {
            type: String,
            required: true
        },
        objectcreator: {
            type: String,
            required: true
        },
    }
}

const app = Vue.createApp({
    data() {
        return {
            search: "",
            searchOption: "creator",
            style: "",
            nationality: "",
            medium: "",
            allObjects: [],
            filteredObjects: [],
            textFilteredObjects: [],
            displayedObjects: [],
            filters: [],
            pageNum: 0
        }
    },


    methods: {
        applyFilter(event) {
            var style = this.style;
            var nationality = this.nationality;
            var medium = this.medium;

            function filterCompare(value) {
                if (!Array.isArray(value.nationality)) {
                    return false;
                } else if (event == 'style') {
                    //TODO
                } else if (event == 'nationality') {
                    for (var i = 0; i < value.nationality.length; i++) {
                        if (value.nationality[i].toUpperCase() == nationality.toUpperCase()) {
                            return true;
                        }
                    }
                } else if (event == 'medium') {
                    if (value.medium.toUpperCase() == medium.toUpperCase()) {
                        return true;
                    }
                }

                return false;
            }

            this.filteredObjects = this.filteredObjects.filter(filterCompare);

            var value;
            this.search = "";
            if (event == 'style') {
                value = style;
                this.style = "";
            } else if (event == 'nationality') {
                value = nationality;
                this.nationality = "";
            } else if (event == 'medium') {
                value = medium;
                this.medium = "";
            }
            this.filters.push({
                type: event,
                value: value
            });

            this.pageNum = 0;
            this.displayedObjects = [];
            for (var i = this.pageNum * 12; (i < this.filteredObjects.length) && (i < (this.pageNum * 12) + 12); i++) {
                this.displayedObjects.push(this.filteredObjects[i]);
            }
        },
        applyTextFilter() {
            var search = this.search;
            var searchOption = this.searchOption;

            if (search == "") {
                for (var i = this.pageNum * 12; (i < this.filteredObjects.length) && (i < (this.pageNum * 12) + 12); i++) {
                    this.displayedObjects.push(this.filteredObjects[i]);
                }
            }

            function filterCompare(value) {
                if (searchOption == "creator") {
                    for (var i = 0; i < value.creator.length; i++) {
                        if (value.creator[i].toUpperCase().includes(search.toUpperCase())) {
                            return true;
                        }
                    }
                } else if (searchOption == "title") {
                    if (value.title.toUpperCase().includes(search.toUpperCase())) {
                        return true;
                    }
                } else if (searchOption == "idNumber") {
                    if (value.id.toUpperCase().includes(search.toUpperCase())) {
                        return true;
                    }
                } else if (searchOption == "subjectTerm") {
                    //TODO
                }
                return false;
            }

            this.textFilteredObjects = this.filteredObjects.filter(filterCompare);

            this.pageNum = 0;
            this.displayedObjects = [];
            for (var i = this.pageNum * 12; (i < this.textFilteredObjects.length) && (i < (this.pageNum * 12) + 12); i++) {
                this.displayedObjects.push(this.textFilteredObjects[i]);
            }
        },
        confirmTextFilter() {
            if (this.search == "") {
                return;
            }

            this.filteredObjects = this.textFilteredObjects;

            this.filters.push({
                type: this.searchOption,
                value: this.search
            });
        }
    },


    mounted: async function() {
        for(var i = 0; i < testResponse.results.length; i++) {
            var image = testResponse.results[i]["ca_object_representations.media.original"];
            if (image == null) {
                image = "https://www.salonlfc.com/wp-content/uploads/2018/01/image-not-found-scaled-1150x647.png";
            }
            this.allObjects.push({
                "card": objectCard,
                "id": testResponse.results[i]["idno"],
                "title": testResponse.results[i]["display_label"], 
                "image": image, 
                "creator": testResponse.results[i]["ca_entities.related.preferred_labels.displayname"],
                "date": testResponse.results[i]["ca_objects.displayCreationDate"],
                "medium": testResponse.results[i]["ca_objects.displayMaterialsTech"],
                "nationality": testResponse.results[i]["ca_entities.related.nationalityCreator"]
            });
        }

        for (var i = this.pageNum * 12; i < (this.pageNum * 12) + 12; i++) {
            this.displayedObjects.push(this.allObjects[i]);
        }

        this.filteredObjects = this.allObjects;
    }
});

app.mount("#ca-browse-app");